### Test
```typescript
async () => {
  await CRICKET_API.authenticateAs("VET");
  const response = await CRICKET_API.callApi({
    endpoint: `vaccination/${VACCINATION.id}`,
    method: "GET",
  });

  expect(response).toHaveStatusCode(200);
  expect(response.duration).toHaveResponseTimeBelow(10);
  expect(response.data).toMatchObject(VACCINATION);
  expect(response.data).toMatchSchema("id-response");
};

